import { DeleteIcon } from "@chakra-ui/icons";
import { Box, IconButton } from "@chakra-ui/react";

export const DeleteButton = (props) => {
  return (
    <Box>
      <IconButton
        icon={<DeleteIcon />}
				{...props}
        colorScheme={"red"}
        size="sm"
      />
    </Box>
  );
};
